{"title":"ML Auditbeat Hosts: Process Occurrence","type":"vega","params":{"spec":"{
  $schema: https://vega.github.io/schema/vega-lite/v2.json
  mark: {type: "point"}
  data: {
    url: {
      index: "INDEX_PATTERN_NAME"
      body: {
        size: 10000
        query: {
          bool: {
            must: [
              %dashboard_context-must_clause%
              {
                exists: {field: "process.exe"}
              }
              {
                function_score: {
                  random_score: {seed: 10, field: "_seq_no"}
                }
              }
              {
                range: {
                  @timestamp: {
                    %timefilter%: true
                  }
                }
              }
            ]
            must_not: [
              "%dashboard_context-must_not_clause%"
            ]
          }
        }
        script_fields: {
          process_exe: {
            script: {source: "params['_source']['process']['exe']"}
          }
        }
        _source: ["@timestamp", "process_exe"]
      }
    }
    format: {property: "hits.hits"}
  }
  transform: [
    {calculate: "toDate(datum._source['@timestamp'])", as: "time"}
  ]
  encoding: {
    x: {
      field: time
      type: temporal
      axis: {labels: true, ticks: true, title: false},
      timeUnit: utcyearmonthdatehoursminutes
    }
    y: {
      field: fields.process_exe
      type: ordinal
      sort: {op: "count", order: "descending"}
      axis: {labels: true, title: "occurrence of process.exe", ticks: false}
    }
  }
  config: {
    style: {
      point: {filled: true}
    }
  }
}"},"aggs":[]}
